letras_foo = 'rmdwp'
alfabeto_googlon = 'mbgswfqvhncxdljrktzp'
dicionario_googlon = {}
for i, letra in enumerate(alfabeto_googlon):
	dicionario_googlon[letra] = i


def termina_em_bar(palavra):
	return palavra[-1] not in letras_foo


def conta_preposicoes(texto):
	palavras = texto.strip().split()
	contador = 0
	for palavra in palavras:
		if len(palavra) == 4 and 'f' not in palavra and termina_em_bar(palavra):
			contador += 1
	return contador


def retorna_verbos(texto):
	palavras = texto.strip().split()
	verbos = []
	for palavra in palavras:
		if len(palavra) >= 8 and termina_em_bar(palavra):
			verbos.append(palavra)
	return verbos


def filtra_verbos_em_primeira_pessoa(verbos):
	verbos_em_primeira_pessoa = []
	for verbo in verbos:
		if verbo[0] in letras_foo:
			verbos_em_primeira_pessoa.append(verbo)
	return verbos_em_primeira_pessoa


def primeira_palavra_vem_primeiro_que_segunda(palavra_1, palavra_2):
	tamanho_palavra_1 = len(palavra_1)
	tamanho_palavra_2 = len(palavra_2)
	tamanho_minimo = tamanho_palavra_1 if tamanho_palavra_1 < tamanho_palavra_2 else tamanho_palavra_2
	for i in range(tamanho_minimo):
		if dicionario_googlon[palavra_1[i]] > dicionario_googlon[palavra_2[i]]:
			return 1
		elif dicionario_googlon[palavra_1[i]] < dicionario_googlon[palavra_2[i]]:
			return -1
	if len(palavra_1) > len(palavra_2):
		return 1
	elif len(palavra_1) == len(palavra_2):
		return 0
	return -1


def ordena_palavras(palavras):
	mudou = True
	while mudou:
		mudou = False
		for i in range(len(palavras) - 1):
			if primeira_palavra_vem_primeiro_que_segunda(palavras[i + 1], palavras[i]) == -1:
				palavras[i], palavras[i + 1] = palavras[i + 1], palavras[i]
				mudou = True


def retorna_lista_de_vocabulario(texto):
	palavras = list(set(texto.strip().split()))
	ordena_palavras(palavras)
	return palavras


def converte_numero_googlon_para_decimal(numero):
	lista = list(numero)
	for i, elemento in enumerate(lista):
		lista[i] = dicionario_googlon[elemento]
	soma = 0
	for i, elemento in enumerate(lista):
		soma += elemento * 20 ** i
	return soma


def retorna_numeros(texto):
	palavras = texto.strip().split()
	numeros = []
	for palavra in palavras:
		numeros.append(converte_numero_googlon_para_decimal(palavra))
	return numeros


def retorna_numeros_bonitos(numeros):
	novos_numeros = []
	for numero in numeros:
		if numero >= 664443 and numero % 4 == 0:
			novos_numeros.append(numero)
	return novos_numeros
